#로지스틱 회귀 구현
# 정방향으로 데이터가 흘러가는 과정(정방향 계산)과 가중치를 업데이트 하기 위해 역방향으로 데이터가 흘러가는 과정(역방향 계산)을 구현해야 한다. 
# 회귀 알고리즘 구현에는 무조건 정방향 계산과 역방향 계산, 훈련 함수가 있어야 하는거 같다. 

class LogisticNeuron:
  def __init__(self): # 입력 데이터의 특성(x1, x2, ...)이 많아 w, b를 미리 초기화하지 않는다. 입력 데이터를 보고 특성 개수에 맞게 결정.
    self.w = None
    self_b = None
  
  def forpass(self, x): 
    # np.sum() 사용 : x*self.w에서 x와 w는 1차원 넘파이 배열이며 이들을 곱하면 자동으로 요소값끼리 계산. ex) 넘파이 배열 [1,2,3]과 [3,4,5]을 곱하면 [3, 8, 15]가 나온다.
    # np.sum() 함수의 인자에 넘파이 배열을 전달하면 요소값을 모두 더한 값이 반환된다. 즉, np.sum(x*self.w)은 x*self.w로 만들어진 배열(요소값들을 서로 곱한 배열)의 요소값을 모두 더한 것이 반환된다는 것
    z = np.sum(x*self.w) + self.b # 직선 방정식 계산. 선형 방정식 z = b + w1*x1 + w2*x2 + ... + wn*xn 에서 sum(x*self.w)은 w1*x1 + w2*x2 + ... + wn*xn이다. 
    return z
  def backprop(self, x, err):
    w_grad = x * err # 가중치에 대한 그래디언트 계산
    b_grad = 1 * err # 절편에 대한 그래디언트 계산
    return w_grad, b_grad
  def activation(self, z): # 활성화 함수(시그모이드 함수 사용)
    a = 1/ (1 + np.exp(-z)) # 시그모이드 함수. np.exp : 자연 상수의 자연 지수를 계산
    return a
  #훈련 메서드 구현 : 기존에 작성하던 fit()함수에 활성화 함수가 추가되었다는 점이 다르다.
  def fit(self, x, y, epochs = 100): # x, y는 입력 데이터(넘파이 배열)
    self.w = np.ones(x.shape[1]) # x.shape[1]의 크기를 가진 배열을 만들고 값을 모두 1로 초기화
    self.b = 0 # 절편 초기화
    for i in range(epochs):
      for x_i, y_i in zip(x, y):
        z = self.forpass(x_i) # 선형 함수의 정방향 계산
        a = self.activation(z) # 활성화 함수 -> 0~1 사이의 어떠한 값으로 만들어버림
        err = -(y_i - a) # 오차 계산(로지스틱 회귀의 손실 함수의 도함수 값을 만들기 위함. x를 곱하면 가중치에 대한 미분값, 1을 곱하면 절편에 대한 미분값)
        w_grad, b_grad = self.backprop(x_i, err) # 역방향 계산
        self.w -= w_grad # 가중치 업데이트 
        self.b -= b_grad # 절편 업데이트
  def predict(self, x):# 예측 매서드. 새로운 샘플에 대한 예측값을 계산해준다.
    z = [self.forpass(x_i) for x_i in x] # 리스트 내포(list comprehension) 문법 사용(대괄호 안에 for문을 삽입해 새 리스트를 생성). x에 있는 x_i들을 선형 함수에 넣어서 나온 출력값을 다 담은 리스트 z를 생성
    a = self.activation(np.array(z))# 리스트 z를 넘파이 배열로 만든 뒤 activation() 함수에 전달 -> 반환값으로 0~1사이의 숫자가 하나 나온다. 
    return a > 0.5 # 계단 함수 적용.


#로지스틱 회귀 모델 훈련

# 1. 모델 훈련
neuron = LogisticNeuron()
neuron.fit(x_train, y_train)
# 2. 테스트 세트 사용해 모델의 정확도 평가
# 테스트 세트를 사용해 예측값을 넣고 예측한 값이 맞는지 비교
# predict()의 반환값은 True나 False로 채워진 (m, )크기의 배열이고 y_test는 0 또는 1로 채워진 (m, )크기의 배열 -> 바로 비교 가능
# np.mean(neuron.predict(t_text) == y_test)는 비교문 결과의 평균 계산.
np.mean(neuron.predict(x_test) == y_test) # 0.8245614035087719 출력. 0.8245614035087719는 올바르게 예측한 샘플의 비율. 이를 정확도(accuracy)라고 한다. 

