# 훈련 데이터 세트 저장하기
# 예제 데이터 세트를 x, y에 저장
x = cancer.data
y = cancer.target

# 양성, 음성 클래스의 비율을 일정하게 유지하면서 훈련 데이터 세트 나누기

# 데이터 세트 나누기
from sklearn.model_selection import train_test_split # sklearn.model_selection에서 train_test_split() 함수 임포트.
# train_test_split() 함수는 별도의 입력값이 없다면 훈련 데이터를 훈련 세트 75%, 테스트 세트 25%의 비율로 나눠준다.
x_train, x_test, y_train, y_test = train_test_split(x, y, stratify = y, test_size = 0.2, random_state = 42) #train_test_split()에 x, y 등을 매개변수로 지정
# stratify = y : 훈련 데이터를 나눌 때 클래스 비율을 동일하게 만든다. train_test_split()는 데이터를 나누기 전에 섞지만 일부 클래스 비율이 불균형한 경우 stratify를 y로 지정해야 한다. 
# test_size = 0.2 : 테스트 데이터 비율. 따로 지정하지 않으면 25%(0.25)만큼 테스트 세트에 배정. 이번에는 20%를 데이터 세트에 전달
# random_state = 42 : 앞서 말했듯 train_test_split()는 무작정 데이터 세트를 섞은 뒤 나눈다. random_state를 고정하면 섞은 다음 데이터 세트 둘로 나눈 결과가 항상 일정해진다. 
