#로지스틱 회귀 구현

class LogisticNeuron:
  def __init__(self): # 입력 데이터의 특성(x1, x2, ...)이 많아 w, b를 미리 초기화하지 않는다. 입력 데이터를 보고 특성 개수에 맞게 결정.
    self.w = None
    self.b = None
    self.losses = [] # 손실 함수의 결과값을 저장하는 곳. 손실 함수의 결과값의 평균값(손실값 총합 / 샘플 숫자)을 losses 변수에 저장.
    
  
  def forpass(self, x): 
    z = np.sum(x*self.w) + self.b # 직선 방정식 계산. 
    return z
  def backprop(self, x, err):
    w_grad = x * err # 가중치에 대한 그래디언트 계산
    b_grad = 1 * err # 절편에 대한 그래디언트 계산
    return w_grad, b_grad
  def activation(self, z): # 활성화 함수
    a = 1/ (1 + np.exp(-z)) # 시그모이드 함수.
    return a
  #훈련 메서드
  def fit(self, x, y, epochs = 100): # x, y는 입력 데이터(넘파이 배열)
    self.w = np.ones(x.shape[1]) # x.shape[1]의 크기를 가진 배열을 만들고 값을 모두 1로 초기화
    self.b = 0 # 절편 초기화
    for i in range(epochs):
      loss = 0
      indexes = np.random.permutation(np.arange(len(x)))
      for i in indexes:
        z = self.forpass(x[i])
        a = self.activation(z)
        err = -(y[i] - a)
        w_grad, b_grad = self.backprop(x[i], err)
        self.w -= w_grad
        self.b -= b_grad
        a = np.clip(a, 1e-10, 1-1e-10)
        loss += -(y[i] * np.log(a) + (i-y[i])*np.log(1-a))
      self.losses.append(loss/len(y))

  def predict(self, x):# 예측 매서드. 새로운 샘플에 대한 예측값을 계산해준다.
    z = [self.forpass(x_i) for x_i in x] # 선형 함수의 결과값 반환 
    a = self.activation(np.array(z))# 활성화 함수의 결과값. 범위는 0~1
    return a > 0.5 # 계단 함수 적용.


#로지스틱 회귀 모델 훈련

# 모델 초기화, 훈련
neuron = LogisticNeuron()
neuron.fit(x_train, y_train)